                                        <p class=""card-desc"">
                                            Əmrah Əkbərov 1998-ci il fevralın 21-də Lerik rayonunun Livədirqə kəndində anadan olub. 2004-cü ildə Livədirqə kənd orta məktəbinin 1-ci sinifinə gedir. 2005-ci ildə təhsilini Xəzər rayonunda yerləşən 322 saylı tam orta maktəbdə davam etdirir. O, 2013-cü ildə Cəmşid Naxçıvanski adına hərbi liseyə daxil olmuşdur. 2016-cı ildə həmin liseyi bitirmişdir.
                                            Əmrah Əkbərov 2016-cı ildə Heydər Əliyev adına Azərbaycan Ali Hərbi Məktəbə daxil olmuşdur.2020-ci ildə məktəbi bitirib Azərbaycan Silahlı Qüvvələrinin Xüsusi Təyinatlı Qüvvələrində leytenant rütbəsi alaraq baş kəşfiyyatçı kimi xidmət etməyə başlamışdır.

                                            Azərbaycan Ordusunun Xüsusi Təyinatlı Qüvvələrinin leytenantı olan Əmrah Əkbərov 2020-ci il sentyabrın 27-də Azərbaycan Silahlı Qüvvələri tərəfindən Ermənistan işğalı altında olan ərazilərin azad edilməsi üçün başla");
                WriteLiteral(@"nan Vətən müharibəsi zamanı Cəbrayılın, Hadrutun azadlığı uğrunda gedən döyüşlərdə iştirak etmişdir.Əmrah Əkbərov oktyabr 12-də Hadrut döyüşləri zamanı şəhid olmuşdur.

                                            Azərbaycanın ərazi bütövlüyünün təmin edilməsi uğrunda döyüş əməliyyatlarına qatılan və hərbi hissə qarşısında qoyulmuş tapşırıqların icrası zamanı vəzifə borcunu şərəflə yerinə yetirdiyi üçün Azərbaycan Prezidenti İlham Əliyevin 15.12.2020-ci il tarixli Sərəncamına əsasən Əmrah Əkbərov ölümündən sonra ""Vətən uğrunda"" medalı ilə təltif edildi.

                                            Azərbaycanın Cəbrayıl rayonunun işğaldan azad edilməsi uğrunda aparılan döyüş əməliyyatlarına qatılaraq şəxsi igidliyi və şücaəti nümayiş etdirdiyinə görə Azərbaycan Prezidenti İlham Əliyevin 24.12.2020-ci il tarixli Sərəncamına əsasən Əmrah Əkbərov ölümündən sonra ""Cəbrayılın azad olunmasına görə"" medalı ilə təltif edildi.

                                            Azərbaycanın Xocavənd rayonunun işğaldan az");
                WriteLiteral(@"ad edilməsi uğrunda aparılan döyüş əməliyyatlarına qatılaraq şəxsi igidliyi və şücaəti nümayiş etdirdiyinə görə Azərbaycan Prezidenti İlham Əliyevin 29.12.2020-ci il tarixli Sərəncamına əsasən Əmrah Əkbərov ölümündən sonra ""Xocavəndin azad olunmasına görə"" medalı ilə təltif edildi.

