                                            2012-2016-cı illərdə Heydər Əliyev adına Azərbaycan Ali Hərbi Məktəbində (AAHM) ali hərbi təhsil alaraq ""leytenant"" hərbi rütbəsi aldı və 2016-cı ildən hərbi xidmətə başladı. Subay idi.

                                            Azərbaycan Ordusunun baş leytenantı olan Elmar Mirzəyev 2020-ci il sentyabrın 27-də Azərbaycan Silahlı Qüvvələri tərəfindən Ermənistan işğalı altında olan ərazilərin azad edilməsi üçün başlanan Vətən müharibəsi zamanı Murovdağ döyüşlərində, həmçinin Füzulinin və Xocavəndin azadlığı uğrunda gedən döyüşlərdə savaşıb. Elmar Mirzəyev oktyabrın 15-də Füzuli döyüşləri zamanı şəhid olub. 16 oktyabr 2020-ci il tarixində Biləsuvar rayonunda dəfn olunub.

                                            Azərbaycanın ərazi bütövlüyünün təmin edilməsi uğr");
                WriteLiteral(@"unda döyüş əməliyyatlarına qatılan və hərbi hissə qarşısında qoyulmuş tapşırıqların icrası zamanı vəzifə borcunu şərəflə yerinə yetirdiyi üçün Azərbaycan Prezidenti İlham Əliyevin 15.12.2020-ci il tarixli Sərəncamına əsasən Elmar Mirzəyev ölümündən sonra ""Vətən uğrunda"" medalı ilə təltif edildi.

                                            Azərbaycan ərazilərinin işğaldan azad olunması zamanı döyüş tapşırıqlarını yerinə yerinə yetirən zaman mərdliyin və igidliyin göstərilməsinə görə Azərbaycan Prezidenti İlham Əliyevin 18.12.2020-ci il tarixli Sərəncamına əsasən Elmar Mirzəyev ölümündən sonra ""İgidliyə görə"" medalı ilə təltif edildi.

                                            Azərbaycanın Kəlbəcər rayonunun işğaldan azad edilməsi uğrunda aparılan döyüş əməliyyatlarına qatılaraq şəxsi igidliyi və şücaəti nümayiş etdirdiyinə görə Azərbaycan Prezidenti İlham Əliyevin 29.12.2020-ci il tarixli Sərəncamına əsasən Elmar Mirzəyev ölümündən sonra ""Kəlbəcərin azad olunmasına görə"" medalı ilə təltif edildi.

   ");
                WriteLiteral(@"                                         Azərbaycanın Xocavənd rayonunun işğaldan azad edilməsi uğrunda aparılan döyüş əməliyyatlarına qatılaraq şəxsi igidliyi və şücaəti nümayiş etdirdiyinə görə Azərbaycan Prezidenti İlham Əliyevin 24.06.2021-ci il tarixli Sərəncamına əsasən Elmar Mirzəyev ölümündən sonra ""Xocavəndin azad olunmasına görə"" medalı ilə təltif edildi.

