                WriteLiteral(@"
                                        <p class=""card-desc"">
                                            Xəyyam Əzizov 8 noyabr 1995-ci ildə Neftçala şəhərində fəhlə ailəsində anadan olub. 2 qardaş olmaqla ailədə 4 nəfər olublar. Uşaqlıq illərini doğulduğu Neftçala şəhərində keçirib. 2002-ci ildə Neftçala şəhər Mehman Səfərov adına İnteqrasiya təlimli İnternat tipli gimnaziya məktəbinin 1-ci sinfinə daxil olub və 2006-cı ildə ibtidai sinfini başa vurduqdan sonra Neftçala şəhər Humanitar Təmayüllü Muğan liseyində təhsilini davam etdirib. 2010-cu ildə 8-ci sinfi başa vurduqdan sonra Cəmşid Naxçıvanski adına hərbi liseyə qəbul olub. 2013-cü ildə liseyi bitirdikdən sonra isə Heydər Əliyev adına Azərbaycan Ali Hərbi Məktəbinə daxil olub. 2017-ci ildə həmin məktəbi bakalavr diplomlu xüsusi təyinatlı kimi bitirib və ""leytenant"" hərbi rütbəsi verilib. Xəyyam öz istəyi ilə Xüsusi Təyinatlı Qüvvələrin kursunu keçərək zabit kimi xidmətinə qədəm qoyub. Leytenant Xəyyam xidməti dövründə bir neçə xarici ölkələrdə dağçı");
                WriteLiteral(@"lıq, xizəkçilik və paraşütçülük kurslarını yüksək göstəricilərlə başa vurur. 2020-ci ildə leytenant Xəyyam Əzizova baş leytenant hərbi rütbəsi verilir. Həmin il Rusiyanın Moskva şəhərində keçirilən qələbə paradında Azərbaycanı layiqincə təmsil edir. 27 sentybar 2020-ci il tarixində başlayan və 44 gün davam edən II Qarabağ müharibəsində Xəyyam bir Xüsusi Təyinatlıların zabiti kimi iştirak edir. Füzuli, Cəbrayıl, Qubadlı və Şuşa uğrunda gedən ağır döyüşlərdə iştirak edir, böyük şücaətlər göstərir, düşmənə sarsıdıcı zərbələr endirir və xeyli sayda canlı qüvvəsini məhv edir. Qəhrəman Xəyyam döyüş yoldaşlarının ruh yüksəkliyini artırmaq üçün onlara şirniyyat paylayır. Ən son döyüş meydanı olan əlçatmaz Şuşa şəhərinin azad olunmasında əsl qəhrəmanlıq göstərir və özünün doğum günündə -08 noyabr 2020-ci il tarixində şəhadət şərbətini içərək Allahın ən uca məqamı olan şəhidlik məqamına ucalır. Şəhidin nəşi doğulub, boya-başa çatdığı Neftçala şəhərinə gətirilir və böyük izdihamla torpağa tapşırılır.
                  ");
                WriteLiteral(@"                          Azərbaycan Ordusunun baş leytenantı olan Xəyyam Əzizov 2020-ci il sentyabrın 27-də Azərbaycan Silahlı Qüvvələri tərəfindən Ermənistan işğalı altında olan ərazilərin azad edilməsi üçün başlanan Vətən müharibəsi zamanı Cəbrayılın, Füzulinin və Şuşanın azadlığı uğrunda gedən döyüşlərdə savaşıb. Xəyyam Əzizov noyabrın 6 da döyüş tapşırığının yerinə yetirilməsi zamanı ayağından ağır yaralanmış lakin döyüş bölgəsindən təxliyyə edilməsinə razı olmayaraq sona kimi mübarizəni davam etdirmişdir və noyabrın 8-də Şuşa döyüşləri zamanı şəhid olub. Neftçala rayonunda dəfn olunub.

                                            Azərbaycanın ərazi bütövlüyünün təmin edilməsi uğrunda döyüş əməliyyatlarına qatılan və hərbi hissə qarşısında qoyulmuş tapşırıqların icrası zamanı vəzifə borcunu şərəflə yerinə yetirdiyi üçün Azərbaycan Prezidenti İlham Əliyevin 15.12.2020-ci il tarixli Sərəncamına əsasən Xəyyam Əzizov ölümündən sonra ""Vətən uğrunda"" medalı ilə təltif edildi.

                             ");
                WriteLiteral(@"               Azərbaycanın ərazi bütövlüyünün bərpa edilməsi zamanı döyüş əməliyyatlarının rəhbəri olan, düşmənin canlı qüvvəsinin və döyüş texnikasının məhv edilməsində rəşadət göstərən, vəzifə borcunu ləqayətlə və vicdanla yerinə yetirdiyinə görə Azərbaycan Prezidenti İlham Əliyevin 15.12.2020-ci il tarixli Sərəncamına əsasən Xəyyam Əzizov ölümündən sonra ""Azərbaycan Bayrağı"" ordeni ilə təltif edildi.

                                            Azərbaycanın Cəbrayıl rayonunun işğaldan azad edilməsi uğrunda aparılan döyüş əməliyyatlarına qatılaraq şəxsi igidliyi və şücaəti nümayiş etdirdiyinə görə Azərbaycan Prezidenti İlham Əliyevin 24.12.2020-ci il tarixli Sərəncamına əsasən Xəyyam Əzizov ölümündən sonra ""Cəbrayılın azad olunmasına görə"" medalı ilə təltif edildi.

                                            Azərbaycanın Şuşa rayonunun işğaldan azad edilməsi uğrunda aparılan döyüş əməliyyatlarına qatılaraq şəxsi igidliyi və şücaəti nümayiş etdirdiyinə görə Azərbaycan Prezidenti İlham Əliyevin 29.12.20");
                WriteLiteral(@"20-ci il tarixli Sərəncamına əsasən Xəyyam Əzizov ölümündən sonra ""Şuşanın azad olunmasına görə"" medalı ilə təltif edildi.

                                            Azərbaycanın Füzuli rayonunun işğaldan azad edilməsi uğrunda aparılan döyüş əməliyyatlarına qatılaraq şəxsi igidliyi və şücaəti nümayiş etdirdiyinə görə Azərbaycan Prezidenti İlham Əliyevin 24.06.2021-ci il tarixli Sərəncamına əsasən Xəyyam Əzizov ölümündən sonra ""Füzulinin azad olunmasına görə"" medalı ilə təltif edildi.

                                            Azərbaycanın Xocavənd rayonunun işğaldan azad edilməsi uğrunda aparılan döyüş əməliyyatlarına qatılaraq şəxsi igidliyi və şücaəti nümayiş etdirdiyinə görə Azərbaycan Prezidenti İlham Əliyevin 24.06.2021-ci il tarixli Sərəncamına əsasən Xəyyam Əzizov ​ölümündən sonra ""Xocavəndin azad olunmasına görə"" medalı ilə təltif edildi
                                        </p>
