                WriteLiteral(@"
                                        <p class=""card-desc"">
                                            Camal İsmayılov 1984-cü il iyulun 7-də Neftçala rayonunun Həsənabad qəsəbəsində anadan olmuşdur. Onun ailədə bir bacısı və bir qardaşı olmuşdur. 1986-cı ildə — Camal İsmayılovun 2 yaşı olanda İsmayılovlar ailəsi Neftçala rayonundan Rusiyanın Krasnoyarsk diyarının İqarka şəhərində yaşamağa başlamışdılar.

                                            Camal İsmayılov 2015-ci il martın 2-dən aprelin 2-nə qədər Konya şəhərinin 3-cü Ana Jet Üs Komutanlığında baş tutan ""TURAZ Şahini — 2015"" hərbi təlimlərinə qatılmışdır və buna görə diplomla təltif edilmişdir.

                                            Camal İsmayılov 2015-ci il mayın 9-da Faşizm üzərində Qələbənin 70 illiyi münasibətilə Rusiyanın Qızıl meydanında baş tutan parad zamanı mayor Mehdi Mahmudovun rəhbərliyi altında 70 nəfərdən ibarət olan Azərbaycan Silahlı Qüvvələrinin qrupunun heyətində idi.

                                            D");
                WriteLiteral(@"aha sonra isə o, 2015-ci il sentyabrın 28-dən oktyabrın 16-na qədər Gürcüstanda baş tutan dağçılıq üzrə hərbi təlimlərə qatılmışdır və buna görə diplomla təltif edilmişdir.

                                            2019-cu ilin 6–24 mayında 5 dövlətin qatıldığı və Kayseri şəhəri yaxınlığında yerləşən Ərciyəs dağında baş tutan ""ERCİYES - 2019"" hərbi təlimlərinə qatılmışdır, buna görə də diplomlarla təltif edilmişdir.

                                            Camal İsmayılov və 40 nəfərdən ibarət olan qrup oktyabrın 19-da Laçın dəhlizinə nəzarəti ələ almaq üçün ciddi önəmə və strateji əhəmiyyətə sahib olan mövqelər uğrunda döyüşlərə daxil olmuşdular. Döyüşlər əvvəlcə Qubadlı rayonu istiqamətində olan əlverişli mövqelər uğrunda aparılmışdır. Qeyri-bərabər şəraitdə olan döyüşlərdə Ermənistan tərəfdən ~150–200 hərbi qulluqçusu döyüşmüşdür. 7 saatdan çox davam edən ağır döyüşlər nəticəsində Xüsusi Təyinatlı Qüvvələrdə Qrupun şəxsi heyətindən dörd nəfər — baş gizir Camal İsmayılov, baş gizir Sübhan Cəbrayı");
                WriteLiteral(@"lov, gizir Şəhriyar Quliyev və gizir Elyar Vəliyev şəhid olmuşdur. Ümumi olaraq Camal İsmayılovun mənsub olduğu tabor müharibə zamanı Xüsusi Təyinatlı Qüvvələrin ən çox şəhid verən taborudur. Camal İsmayılovun şəhid olduğu ayın 21-də, anasını doğum günündə təsdiq olunmuşdur. Neftçala şəhərində dəfn olunmuşdur.

                                            Azərbaycanın ərazi bütövlüyünün bərpa edilməsində xüsusi xidmətlərinə və işğal olunmuş ərazilərin azad olunması zamanı düşmənin məhv edilməsi üzrə qarşıya qoyulmuş döyüş tapşırığını yerinə yetirən zaman göstərdiyi qəhrəmanlıq nümunəsinə görə, həmçinin hərbi qulluq vəzifəsini yerinə yetirən zamanı igidliyin və mərdliyin nümayiş etdirilməsinə görə Azərbaycan Prezidenti İlham Əliyevin 09.12.2020-ci il tarixli Sərəncamına əsasən Camal İsmayılova ""Vətən Müharibəsi Qəhrəmanı"" adı verildi.

                                            Azərbaycanın ərazi bütövlüyünün təmin edilməsi uğrunda döyüş əməliyyatlarına qatılan və hərbi hissə qarşısında qoyulmuş tapşırıqla");
                WriteLiteral(@"rın icrası zamanı vəzifə borcunu şərəflə yerinə yetirdiyi üçün Azərbaycan Prezidenti İlham Əliyevin 15.12.2020-ci il tarixli Sərəncamına əsasən Camal İsmayılov ölümündən sonra ""Vətən uğrunda"" medalı ilə təltif edildi.

                                            Azərbaycanın Cəbrayıl rayonunun işğaldan azad edilməsi uğrunda aparılan döyüş əməliyyatlarına qatılaraq şəxsi igidliyi və şücaəti nümayiş etdirdiyinə görə Azərbaycan Prezidenti İlham Əliyevin 24.12.2020-ci il tarixli Sərəncamına əsasən Camal İsmayılov ölümündən sonra ""Cəbrayılın azad olunmasına görə"" medalı ilə təltif edildi.

                                            Azərbaycanın Füzuli rayonunun işğaldan azad edilməsi uğrunda aparılan döyüş əməliyyatlarına qatılaraq şəxsi igidliyi və şücaəti nümayiş etdirdiyinə görə Azərbaycan Prezidenti İlham Əliyevin 24.06.2021-ci il tarixli Sərəncamına əsasən Camal İsmayılov ölümündən sonra ""Füzulinin azad olunmasına görə"" medalı ilə təltif edildi.

                                            Azərbaycanın");
