                                            Anar Nağıyev 1989-cu il oktyabrın 30-da Gəncə şəhərində anadan olub. 1996-2000-ci illərdə Samux rayonunda Alıuşağı kənd tam orta məktəbində, 2000-2007-ci illərdə isə Qazax rayonunda S. Nəsirov adına Ürkməzli kənd tam orta məktəbində təhsil alıb. Ailəli idi. 1-ci nigahdan bir qızı və bir oğlu, 2-ci nigahdan isə 25.01.2021-ci il təvəllüdlü Anarə adında bir qızı yadigar qaldı.
                                            Anar Nağıyev 2008-2009-cu illərdə Azərbaycan Silahlı Qüvvələrinin sıralarında müddətli həqiqi hərbi xidmətdə olub. 2009-cu ildən isə müddətdən artıq həqiqi hərbi xidmət qulluqçusu idi.

                                            Azərbaycan Ordusunun giziri olan Anar Nağıyev 2020-ci il sentyabrın 27-də Azərbaycan Silahlı Qüvvələri tərəfindən Ermənistan işğalı altında olan ərazilərin azad edilməsi və Azərbaycanın ərazi bütövlüyünün bərpa olunması üçün başlanan Vətən müharibəsi zamanı Şuş");
