                                            Azərbaycanın ərazi bütövlüyünün bərpa edilməsində xüsusi xidmətlərinə və işğal olunmuş ərazilərin azad olunması zamanı düşmənin məhv edilməsi üzrə qarşıya qoyulmuş döyüş tapşırığını yerinə yetirən zaman göstərdiyi qəhrəmanlıq nümunəsinə görə, həmçinin hərbi qulluq vəzifəsini yerinə yetirən zamanı igidliyin və mərdliyin nümayiş etdirilməsinə görə Azərbaycan Prezidenti İlham Əliyevin 09.12.2020-ci il tarixli Sərəncamına əsasən Anar Nağıyev ölümündən sonra ""Qarabağ"" ordeni ilə təltif edildi.

                                            Azərbaycanın ərazi bütövlüyünün təmin edilməsi uğrunda döyüş əməliyyatlarına qatılan və hərbi hissə qarşısında qoyulmuş tapşırıqların icrası zamanı vəzifə borcunu şərəflə yerinə yetirdiyi üçün Azərbaycan Prezidenti İlham Əliyevin 15.12.2020-ci il tarixli Sərəncamına əsasən Anar N");
                WriteLiteral(@"ağıyev ölümündən sonra ""Vətən uğrunda"" medalı ilə təltif edildi.

