                WriteLiteral(@"
                                        <p class=""card-desc"">
                                            Cavid Hüseynov 1993-cü il dekabrın 12-də Tovuz rayonunun Alakol kəndində anadan olub.[1] 2000-2011-ci illərdə N.Sadıqov adına Alakol kənd tam orta məktəbində təhsil alıb. Subay idi. Cavid Hüseynov 2012-ci ildə müddətli həqiqi hərbi xidmətə çağırılıb.  2012-2013-cü illərdə Azərbaycan Silahlı Qüvvələrinin “N” saylı hərbi hissəsində xidmət edib. 2014-cü ildən Xüsusi Təyinatlı Qüvvələrin “N” saylı hərbi hissəsində xidmət edirdi. Cavid Hüseynov məharətli snayperçi idi. O, snayper təlimatçısı olub; dəfələrlə “Ən yaxşı snayper” fəxri fərmanı ilə təltif edilib. 2019-cu ildə Belarus hərbi idman oyunları üzrə snayper yarışında 21 ölkə iştirakçısı arasında komanda hesabında 2-ci, fərdi yarışda 1-ci yeri tutub.
